import React from 'react';

function Nav() {


    return(
        <header>
            <h1 id='signature'> <a href='/'>JCV</a></h1>
            <nav>
                <ul>
                    <li> <a href='/'>About</a> </li>
                    <li> <a href='/'>Projects</a> </li>
                    <li> <a href='/'>Contact</a> </li>
                    <li> <a href='/'>Resume</a> </li>
                </ul>
            </nav>

        </header>
    );
}



export default Nav;
